schemaDefinition: "create or replace view VW_U_LEAD_ACCOUNT_MAPPING(\n\tLEAD_SYS_ID,\n\
  \tLEAD_NUMBER,\n\tACCOUNT_SYS_ID,\n\tACCOUNT_NAME,\n\tACCOUNT_NUMBER,\n\tSYS_MOD_COUNT,\n\
  \tINCOMING_LEAD_NAME,\n\tSYS_UPDATED_ON,\n\tSYS_TAGS,\n\tACCOUNT_NAME_IN_DNB_OR_ACCOUNT,\n\
  \tSYS_ID,\n\tACCOUNT_COUNTRY_CODE,\n\tACCOUNT_COUNTRY_NAME,\n\tSYS_UPDATED_BY,\n\
  \tSYS_CREATED_ON,\n\tINGORE_FLAG,\n\tRECORD_TYPE,\n\tSYS_CREATED_BY,\n\tPSP_PER_INSERT_DT,\n\
  \tPSP_PER_DELETE_DT,\n\tPSP_PER_UPDATE_DT,\n\tLEAD_ACCOUNT_MAPPING_KEY\n) as\nSELECT\
  \  U_LEAD_REF LEAD_SYS_ID,\n\tDV_U_LEAD_REF LEAD_NUMBER,\n\tU_ACCOUNT_REF ACCOUNT_SYS_ID,\n\
  \tDV_U_ACCOUNT_REF ACCOUNT_NAME,\n\tU_ACCOUNTNUMBER ACCOUNT_NUMBER,\n\tSYS_MOD_COUNT\
  \ ,\n\tU_INCOMINGLEADNAME INCOMING_LEAD_NAME,\n\tSYS_UPDATED_ON ,\n\tSYS_TAGS,\n\
  \tU_ACCOUNTNAMEINDNBORACCOUNT ACCOUNT_NAME_IN_DNB_OR_ACCOUNT,\n\tSYS_ID ,\n\tU_ACCOUNTCOUNTRY\
  \ ACCOUNT_COUNTRY_CODE,\n\tDV_U_ACCOUNTCOUNTRY ACCOUNT_COUNTRY_NAME,\n\tSYS_UPDATED_BY\
  \  ,\n\tSYS_CREATED_ON ,\n\tU_IGNORE  INGORE_FLAG,\n\tU_RECORDTYPE RECORD_TYPE,\n\
  \tSYS_CREATED_BY ,\n\tPSP_PER_INSERT_DT ,\n\t--PSP_DELETE ,\n\tPSP_PER_DELETE_DT\
  \ ,\n\tPSP_PER_UPDATE_DT --,\n\t, DV_U_ACCOUNTCOUNTRY ||'random' || U_INCOMINGLEADNAME\
  \ AS LEAD_ACCOUNT_MAPPING_KEY\nFROM\t RDS.SURF.U_LEAD_ACCOUNT_MAPPING;"
